declare namespace org {
    namespace apache {
        namespace tomcat {
            namespace util {
                namespace bcel {
                    namespace classfile {
                        /**
                         * represents one annotation in the annotation table
                         */
                        // @ts-ignore
                        class AnnotationEntry extends java.lang.Object {
                            /**
                             * @return the annotation type name
                             */
                            // @ts-ignore
                            public getAnnotationType(): string
                            /**
                             * @return the element value pairs in this annotation entry
                             */
                            // @ts-ignore
                            public getElementValuePairs(): Array<org.apache.tomcat.util.bcel.classfile.ElementValuePair>
                        }
                    }
                }
            }
        }
    }
}
